import React from 'react'

    const MovieID = ({ ID }) => {
      return (
        <div>
          <center><h1>Movie IDs</h1></center>
          {ID.map((id) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{id}</h5>
              </div>
            </div>
          ))}
        </div>
      )
    };

    export default MovieID
